const socialListData = [
    {
        _id: crypto.randomUUID(),
        target: 'facebook',
        icon: 'bi-meta',
        active: true
    
    },
    
    {
        _id: crypto.randomUUID(),
        target: 'twitter',
        icon: 'bi-twitter-x',
        active: false
    
    },
    
    {
        _id: crypto.randomUUID(),
        target: 'youtube',
        icon: 'bi-youtube',
        active: false
    
    },
    
    {
        _id: crypto.randomUUID(),
        target: 'share',
        icon: 'bi-share',
        active: false
    
    }
    
    
    
    
    ];
    
    export default socialListData;
